import logo from './logo.svg';
import './App.css';

import { Routes, Route } from 'react-router-dom';
import index from './paginacion/Index';
import Rutas from './paginacion/Rutas';
import Login from './paginacion/login/Login';
import Registro from './paginacion/registro/Registro';
import Header from './estructura/Header';
import Footer from './estructura/Footer';
import Platillos from './paginacion/platillos/Platillos';
import Bebidas from './paginacion/bebidas/Bebidas';
import Conexion from './conexion/Conexion';
import Copia from './paginacion/Copia';
import informacion from './paginacion/Informacion/Informacion';
import Terminos from './terminos/Terminos';
import Politicas from './politicas/Politicas';
import Panel from './paginacion/panel/Panel';
import Perfil from './paginacion/panel/Perfil';
import CrudProductos from './adm/productos/CrudProductos';
import CrudUsuarios from './adm/usuarios/CrudUsuarios';
// import CrudProductos2 from './adm/ejemplo/CrudProductos';
import Index from './paginacion/Index';
import EditarUsuario from './adm/usuarios/EditarUsuario';
import Crud from './adm/usuarios/Crud';
import Usuarios from './adm/usuarios/Usuarios';
import CheckCorreo from './recovery/CheckCorreo';
import CheckCode from './recovery/CheckCode';
// import login2 from './paginacion/login2/login2';
// import Login3 from './paginacion/login3/login3';

function App() {
  return (
    <div className="App">
      <h1>RUTAS</h1>
      <Routes>
        <Route path='/'  Component={ Rutas} />
          <Route path='/header' Component={ Header }></Route>
          <Route path='/footer' Component={ Footer  }></Route>
          <Route path='/platillos' Component={ Platillos } />
          <Route path='/bebidas' Component={ Bebidas } />
          <Route path='/informacion' Component={ informacion } /> 
          <Route path='/registro' Component={ Registro }></Route>
          <Route path='/login' Component={ Login }></Route>
          <Route path='/terminos' Component={ Terminos }></Route>
          <Route path='/conexion' Component={ Conexion  }></Route>
          <Route path='/copia' Component={ Copia }></Route>
          <Route path='/help' Component={ Copia }></Route>
          <Route path='/politicas' Component={ Politicas }></Route>
          <Route path='/panel' Component={ Panel }></Route>
          <Route path='/perfil' Component={ Perfil }></Route>
          <Route path='/crudProductos' Component={ CrudProductos }></Route>
          <Route path='/crudUsuarios' Component={ CrudUsuarios }></Route>
          <Route path='/index' Component={ Index }></Route>
          <Route path='/editarUsuario' Component={ EditarUsuario }></Route>
          <Route path='/crud' Component={ Crud }></Route>
          <Route path='/usuarios' Component={ Usuarios }></Route>
          <Route path='/checkcorreo' Component={ CheckCorreo }></Route>
          <Route path='/checkcode' Component={ CheckCode }></Route>
      </Routes>
    </div>
  );
}

export default App;
